import{_ as a,a as r,b as t,c as e,d as i,e as l,f as n,g as o}from"./chunks/qgc_actuator_config.B5iBnftH.js";import{_ as h,c as s,o as g,ab as c}from"./chunks/framework.CUflZczI.js";const y=JSON.parse('{"title":"Wing Wing Z84 Pixracer Збірка","description":"","frontmatter":{},"headers":[],"relativePath":"uk/frames_plane/wing_wing_z84.md","filePath":"uk/frames_plane/wing_wing_z84.md"}'),p={name:"uk/frames_plane/wing_wing_z84.md"},d=c('<h1 id="wing-wing-z84-pixracer-збірка" tabindex="-1">Wing Wing Z84 Pixracer Збірка <a class="header-anchor" href="#wing-wing-z84-pixracer-збірка" aria-label="Permalink to &quot;Wing Wing Z84 Pixracer Збірка&quot;">​</a></h1><p>Літаюче крило Wing Wing Z-84 - це каркас літаючого крила. Це невелике, міцне і достатньо велике, щоб розмістити <a href="./../flight_controller/pixracer.html">Pixracer</a>.</p><p>Основна Інформація:</p><ul><li><strong>Каркас:</strong> Wing Wing Z-84</li><li><strong>Контролер польоту:</strong> Pixracer</li></ul><p><img src="'+a+'" alt="Wing Wing Z-84 build"></p><h2 id="список-деталеи" tabindex="-1">Список деталей <a class="header-anchor" href="#список-деталеи" aria-label="Permalink to &quot;Список деталей&quot;">​</a></h2><h3 id="z-84-plug-n-fly-pnf-pnp-або-комплект" tabindex="-1">Z-84 Plug n&#39; Fly (PNF/PNP) або Комплект <a class="header-anchor" href="#z-84-plug-n-fly-pnf-pnp-або-комплект" aria-label="Permalink to &quot;Z-84 Plug n&#39; Fly (PNF/PNP) або Комплект&quot;">​</a></h3><p>Один з цих:</p><ul><li><a href="https://www.banggood.com/Wing-Wing-Z-84-Z84-EPO-845mm-Wingspan-Flying-Wing-PNP-p-973125.html" target="_blank" rel="noreferrer">Banggood</a></li><li><a href="https://hobbyking.com/en_us/wing-wing-z-84-epo-845mm-kit.html" target="_blank" rel="noreferrer">Склад Hobbyking у США</a></li></ul><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Версії PNF (або &quot;PNP&quot;) включають двигун, гвинт і електронний регулятор швидкості. Версія &quot;комплекту&quot; не включає ці компоненти, які слід окремо придбати.</p></div><h3 id="електроннии-регулятор-швидкості-esc" tabindex="-1">Електронний регулятор швидкості (ESC) <a class="header-anchor" href="#електроннии-регулятор-швидкості-esc" aria-label="Permalink to &quot;Електронний регулятор швидкості (ESC)&quot;">​</a></h3><p>Один з цих (будь-який малий (&gt;=12A) ESC підійде):</p><ul><li><a href="https://hobbyking.com/en_us/turnigy-20a-brushed-esc.html" target="_blank" rel="noreferrer">Turnigy 20A Brushed ESC ESC</a> (Hobbyking)</li><li><a href="https://www.getfpv.com/lumenier-30a-blheli-s-esc-opto-2-4s.html" target="_blank" rel="noreferrer">Регулятор Lumenier 30A BLHeli_S ESC OPTO</a> (GetFPV)</li></ul><h3 id="автопілот-та-основні-компоненти" tabindex="-1">Автопілот та основні компоненти <a class="header-anchor" href="#автопілот-та-основні-компоненти" aria-label="Permalink to &quot;Автопілот та основні компоненти&quot;">​</a></h3><ul><li>Набір <a href="./../flight_controller/pixracer.html">Pixracer</a> (включаючи GPS та модуль живлення)</li><li>Приймач FrSky D4R-II або йому еквівалентний (з&#39;єднаний за допомогою перемички з виходом PPM sum відповідно до інструкції)</li><li><a href="./../flight_controller/pixfalcon.html#availability">Міні набір телеметрії</a> для Holybro pix32</li><li><a href="./../flight_controller/pixfalcon.html#availability">Цифровий датчик швидкості повітря</a> для Holybro pix32 / Pixfalcon</li><li>1800 mAh 2S LiPo Battery - наприклад, <a href="https://teamorion.com/en/batteries-en/lipo/soft-case/team-orion-lipo-1800-2s-7-4v-50c-xt60-en/" target="_blank" rel="noreferrer">Team Orion 1800mAh 7.4V 50C 2S1P</a></li></ul><h3 id="рекомендовані-запасні-частини" tabindex="-1">Рекомендовані запасні частини <a class="header-anchor" href="#рекомендовані-запасні-частини" aria-label="Permalink to &quot;Рекомендовані запасні частини&quot;">​</a></h3><ul><li>1 см діаметр ущільнювача O-кільце для зберігача пропелера (<a href="https://hobbyking.com/en_us/wing-wing-z-84-o-ring-10pcs.html" target="_blank" rel="noreferrer">Hobbyking</a>)</li><li>125x110 мм пропелери (<a href="https://hobbyking.com/en_us/gws-ep-propeller-dd-5043-125x110mm-green-6pcs-set.html" target="_blank" rel="noreferrer">Гобікінг</a>)</li></ul><h2 id="підключення" tabindex="-1">Підключення <a class="header-anchor" href="#підключення" aria-label="Permalink to &quot;Підключення&quot;">​</a></h2><p>Проведіть дроти до сервоприводів та двигунів, як показано. Використовуйте виходи <code>MAIN</code> (не ті, які позначені як AUX). Регулятор обертань потрібно мати вбудований BEC, оскільки автопілот не живить рейку сервопривода.</p><table><thead><tr><th>Порт</th><th>Підключення</th></tr></thead><tbody><tr><td>RC IN</td><td>PPM або вхід S.BUS / S.BUS2</td></tr><tr><td>MAIN 1</td><td>Лівий елерон</td></tr><tr><td>MAIN 2</td><td>Правий елерон</td></tr><tr><td>MAIN 3</td><td>Пусто</td></tr><tr><td>MAIN 4</td><td>Двигун 1</td></tr></tbody></table><h2 id="журнал-збірки" tabindex="-1">Журнал збірки <a class="header-anchor" href="#журнал-збірки" aria-label="Permalink to &quot;Журнал збірки&quot;">​</a></h2><p>Зображення нижче дають уявлення про процес збирання, який є простим і може бути виконаний за допомогою паяльної пістолета.</p><p><img src="'+r+'" alt="wing wing build01"> <img src="'+t+'" alt="wing wing build02"> <img src="'+e+'" alt="wing wing build03"> <img src="'+i+'" alt="wing wing build04"> <img src="'+l+'" alt="wing wing build09"> <img src="'+a+'" alt="Wing Wing Z-84 build"></p><h2 id="налаштування-px4" tabindex="-1">Налаштування PX4 <a class="header-anchor" href="#налаштування-px4" aria-label="Permalink to &quot;Налаштування PX4&quot;">​</a></h2><h3 id="конфігурація-планера" tabindex="-1">Конфігурація планера <a class="header-anchor" href="#конфігурація-планера" aria-label="Permalink to &quot;Конфігурація планера&quot;">​</a></h3><p>Виберіть <strong>Літаюче крило &gt; Загальне літаюче крило</strong> у конфігурації <a href="./../config/airframe.html">Конфігурація повітряної рами</a> QGroundControl:</p><p><img src="'+n+'" alt="QGC - select firmware for West Wing"></p><h3 id="відображення-приводів" tabindex="-1">Відображення приводів <a class="header-anchor" href="#відображення-приводів" aria-label="Permalink to &quot;Відображення приводів&quot;">​</a></h3><p>Налаштуйте <a href="./../config/actuators.html">Конфігурацію приводів</a>, щоб відповідати з&#39;єднанню для елеронів та керування, як <a href="#wiring">вказано вище</a>.</p><p><img src="'+o+'" alt="QGC - set the actuators"></p><h3 id="інша-конфігурація" tabindex="-1">Інша Конфігурація <a class="header-anchor" href="#інша-конфігурація" aria-label="Permalink to &quot;Інша Конфігурація&quot;">​</a></h3><p>Виконайте всі інші <a href="./../config/">Основні налаштування</a>, включаючи <a href="./../config/autotune.html">Автоналаштування</a>.</p><p>Розширене налаштування є необов&#39;язковим - див. <a href="./../config_fw/">Конфігурацію повітряного судна з фіксованим крилом</a>.</p>',33),m=[d];function u(_,f,b,P,w,k){return g(),s("div",null,m)}const S=h(p,[["render",u]]);export{y as __pageData,S as default};
